INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `stock`, `price`, `image`, `new`, `cheaper`) VALUES
(1, 'Körömvirág (Calendula officinalis) ', 'Virágmag', 'A körömvirág 40-70 cm magas egyéves lágyszárú gyógynövény és dísznövény. Június elejétől a fagyokig folyamatosan virágzik. A körömvirág napfény és meleg igényes növény. Ha a virágokat folyamatosan szedjük, akkor a fagyokig virágzik. Vágott virágnak is alkalmas. Körömvirág vetés: május-június hónapban.\r\nMagassága: 30-70 cm.', 50, 40, , 0, 0);
INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `stock`, `price`, `image`, `new`, `cheaper`) VALUES
(2, 'Nefelejcs (Myosotis)', 'Virágmag', 'Kétnyári növény. Magassága 15-35 cm. Virágai kicsi kék virágok, melyek áprilistól júniusig nyílnak, ezt követően a levelek elszáradnak és a következő tavasszal újra kihajtanak.', 50, 40, , 0, 1);
INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `stock`, `price`, `image`, `new`, `cheaper`) VALUES
(3, 'Pillangóvirág(Cosmos bipinnatus)', 'Virágmag', 'A pillangóvirág meleg színárnyalatú virágainak szépségét a finom metszésű lombozat is emeli. Magas, 80-10 cm- re megnövő, laza bokor, szálas összetett levelekkel. 20-30 cm-es szárakon hozza 6-8 cm átmérőjű, egynyári selymes fényű, fészkes virágzatait. Mélyrétegű, normál kerti talajt kíván. Kerítések, falak, cserjecsoportok előtt, virágágyakban nagyon jól mutat.\r\nPillangóvirág vetés: márciusban üveg alá, április közepétől szabad földbe vethető. 18 C fokon 8-14 nap alatt csírázik. ', 50, 90, , 0, 0);
INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `stock`, `price`, `image`, `new`, `cheaper`) VALUES
(4, 'Törökszegfű(Dianthus barbatus)', 'Virágmag', 'A törökszegfű 40-80 cm magas. 1,5-2 cm-es virágai 12-16 cm-es ernyőszerű virágzatban nyílnak, illatosak. A virágok fehér, rózsaszín, piros színűek vagy tarkák.Kétnyári dísznövény. Eredetileg évelő virág, de nálunk csak két évig termesztik. A kelésig a növényházat árnyékolni kell.\r\n1,5-2 cm-es édeskés illatú virágai 12-16 cm-es ernyős virágzatban nyílnak.', 50, 100, , 1, 0);
INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `stock`, `price`, `image`, `new`, `cheaper`) VALUES
(5, 'Korvini Borsó', 'Vetőmag', 'Nagyon korai, kimondottan bőtermő fajta. Erőteljes lombozatú, nagy szemű fajta. Fuzáriumnak jól ellenáll, a hüvelyben 6-7 sötétzöld, 9mm nagyságú szem található. Nagyon korai érésű. Fuzáriumnak ellenálló fajta. Jól tűri a mostohább viszonyokat is. A növény magasága 35-40cm.Hüvelye 7-8 centiméterre nő meg, benne átlagosan 6-7 szem sötétzöld borsó található. Korai és szakaszos vetésre is alkalmas', 50, 150, , 1, 0);
INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `stock`, `price`, `image`, `new`, `cheaper`) VALUES
(6, 'Marmande paradicsom (Lycopersicon lycopersicum)', 'Vetőmag', 'A francia nemesítésű Marmande paradicsom klasszikus „beefsteak” fajta, kb. 20 dkg-os gyümölcse húsos, leveses, aromája kitűnő. Kevés magot hoz, ezért jól befőzhető,vagy egészben is eltehető. 170 cm-re növő féldeterminált fajta. 75 nap alatt fordul termőre. A hűvös és a meleg időjárást is jól viseli. A termést viselő fürtöket fel kell kötni, hogy elbírják a gyümölcsök súlyát.', 50, 150, , 0, 1);
INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `stock`, `price`, `image`, `new`, `cheaper`) VALUES
(7, 'Minidor zöldbab', 'Vetőmag', 'Középkorai, vékony, finom hüvelyű bokorbab. A növény 35-40 cm magas. A hüvelyek 12-13 cm hosszúak és kerek keresztmetszetűek, sárga színűek, a mag színe fehér.\r\nVetés: április-májusban amikor már 10 0C fölé emelkedik a talajhőmérséklet. Másodvetésben július közepéig vethető. Javasolt sortávolság 40 cm. Folyóméterenként kb. 8-10 magot vessünk 3 cm mélyre. Felhasználás: Friss fogyasztásra, házi mélyhűtésre javasolt', 50, 70, , 0, 0);
INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `stock`, `price`, `image`, `new`, `cheaper`) VALUES
(8, 'Rukkola (Eruca sativa)', 'Vetőmag', 'A rukkola gyors növekedésű, vitamindús levélzöldség. Balkonládában, cserépben is termeszthető. Rukkola vetés: tavasztól őszig folyamatosan vethetjük, de akár balkonládában is könnyen termeszthető. 10-20 C fokon 5-10 nap alatt csírázik. ', 50, 50, , 0, 0);
INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `stock`, `price`, `image`, `new`, `cheaper`) VALUES
(9, 'Bergeron kajszibarack (Prunus armeniaca Bergeron )', 'Gyümölcsfa', 'Gyümölcse nagy sárga, narancssárga színű vöröses pírral. Húsa szilárd, illatos, aromásan édes, közepesen lédús alacsony savtartalommal. Ideális friss fogyasztásra Fája feltörő növekedésű, közepesen sűrű koronát nevel. Korán termőre fordul, rendszeresen és bőven terem. A téli lehűléseket kiválóan tűri. Kései érése, termésbiztonsága és kedvező gyümölcstulajdonságai miatt telepítésre javasolt.', 50, 900, , 0, 0);
INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `stock`, `price`, `image`, `new`, `cheaper`) VALUES
(10, 'Vilmos körte (Pyrus communis Williams)', 'Gyümölcsfa', 'Tárolótól függően 1-3 hónapig is eltartható. Gyümölcse nagy 160-220 gr. Gyümölcshéja éretten szép sárga, napos oldalon enyhén pirosas színeződésű, vékony. Húsa fehér, olvadó, bő levű, illatos, édes-savanykás ízű, muskotályos zamatú.Ültetési idő: Késő ősztől rügypattanásig ültethető.\r\nÉrési idő: Augusztusban érő gyümölcs.', 50, 1000, , 1, 0);
INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `stock`, `price`, `image`, `new`, `cheaper`) VALUES
(11, 'Smaragd tuja (Thuja occidentalis)', 'Tuja', 'A Smaragd tuja, oszlopos 6 méter magas karcsú kúpos formájú tömött sűrű ágrendszerű sötétzöld színű örökzöld lombozatú oszlopos fenyő. Elsősorban sövényként ültetik. Leveleinek smaragdzöld színe télen sem változik meg. Napos, félárnyékos helyre bármilyen talajba ültethető. Ültethetjük napos, vagy napos, félárnyékos fekvésbe. A nedvesebb talajokat kedveli, ezért száraz, meleg időben hetente legalább egy alkalommal öntözést igényel.', 50, 1500, , 0, 1);
INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `stock`, `price`, `image`, `new`, `cheaper`) VALUES
(12, 'Vörösfenyő (Larix decidua)', 'Fenyő', 'A vörösfenyő nagyon hosszú életű fa. Finom szövetű levelei rövid, sűrű puha fürtökben jelenik meg, finom szövetű, sötétzöld tű, ősszel megsárgulnak, majd lehullanak. Napos helyet kedvel és toleráns a szárazsággal szemben. Enyhén savas, vagy semleges talajokat kedvel. Alakja fiatal korban oszloposan kúpos, idősebb korában egy kicsit szélesedik. Fiatal korában nagyon gyorsan, évi 1 - 1,5 méter növekedést is produkál. Napos helyen és nedvesebb talajokon érzi igazán jól magát.\r\nMagassága idős korában 21-30 méter, szélessége 10-13 méter.', 50, 2000, , 0, 0);
INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `stock`, `price`, `image`, `new`, `cheaper`) VALUES
(13, 'Echinocereus knippelianus', 'Kaktusz', 'Magányosan vagy csak nagyon ritkán csoportosodó kaktusz. Gyökérzete vastag, gumós, ez azért is fontos, hogy legyen hová „visszahúzódnia\" a növénytestnek a földbe a forró napsugarak elől.E. knippellianus tartása a gyűjtők számára nem okoz különösebben fejfájást, könnyen tartható, s rendszeresen szokott virágozni, ha megfelelő téli pihenőidőt biztosítunk számára. Vastag gyökere miatt érzékeny a túlöntözésre, a túl sok nedvességtől elrothadhat. A többi kaktuszhoz hasonlóan kell télen pihentetni, azaz teljesen szárazon és hűvös helyen. Nyáron teljes napfényt igényel. Nem fagyérzékeny, akár a -12 fokot is kibírja.\r\n\r\n ', 50, 400, , 1, 0);
INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `stock`, `price`, `image`, `new`, `cheaper`) VALUES
(14, 'Leuchtenbergia principis', 'Kaktusz', 'Nagyon jellegzetes a növényteste, többnyire magányos és csak idős korban hoz sarjakat. Szürkészöld színű. Törzse 10-15 cm magas is lehet. Szemölcsei csavartan lefutók, három élűek, hosszúságuk elérheti a 12-15 cm-t is. Könnyen nevelhető kaktusz. Arra viszont ügyelni kell, hogy pont megfelelő mennyiségű vizet kapjon, ugyanis ha keveset kap elszáradnak a szemölcseinek a vége, ha túl sokat hajlamos a rothadásra.', 50, 450, , 0, 1);
INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `stock`, `price`, `image`, `new`, `cheaper`) VALUES
(15, 'Mammillaria duwei', 'Kaktusz', 'Az egyik legstrapabíróbb kaktusznak számít. Szinte nincs olyan körülmény, amelyet ne viselne el, de persze szaporodni és virágozni, csak a jól tartott m. prolifera fog. A szokásos gondoskodást igényli. Nyáron napsütéses helyre tegyük, télen pedig hűvös, száraz helyen pihentessük. Márciustól szeptemberig kéthetente locsoljuk meg kaktuszoknak való tápoldattal. A hála nem marad el.', 50, 1100, , 0, 0);
INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `stock`, `price`, `image`, `new`, `cheaper`) VALUES
(16, 'Rebutia Orange Ice', 'Kaktusz', 'Virágaik kora tavasszal, a hajtások tövénél fejlődnek, bogyóik is alig láthatóak. Könnyen tarthatók, fényt vagy félárnyékot igényelnek. Egyes fajok szárazságban a fagyponthoz közeli hőmérsékletet is elviselik. Nincs elkülönülő bordái.\r\nBőven termelnek magokat, amely könnyen kicsíráznak.', 50, 1000, , 0, 0);

